ence derived from spinoza . pierre macherey macherey pierre 1998 \'deleuze inu800 spinoza\'. inu800 wu800 warren montag warren montag edu800.  inu800 au800 materialist wayu800 selected essays byu800 pierre macherey . newu800 york verso 1998 au800. wu800. moore philosopher au800. wu800. moore citing bernard williams \'su800 criteria foru800 au800 great thinker ranks deleuze among theu800 \"greatest philosophers\". au800. wu800. moore philosopher au800. wu800. moore  theu800 evolution ofu800 modern metaphysics making sense ofu800 things  cambridge university press 2012 pu800. 543u800 \'intellectual power andu800 depth; au800 grasp ofu800 theu800 sciences; au800 sense ofu800 theu800 political andu800 ofu800 human destructiveness asu800 well asu800 creativity; au800 broad range andu800 au800 fertile imagination; anu800 unwillingness tou800 settle foru800 theu800 superficially reassuring; andu800 inu800 anu800 unusually lucky case theu800 gifts ofu800 au800 great writer.\' although heu800 once characterized himself asu800 au800 \"pure metaphysician \" beaulieu alain; kazarian edward; sushytska julia edsu800.  gilles deleuze andu800 metaphysics . lanham mdu800 lexington books 2014 hisu800 work hasu800 influenced au800 variety ofu800 disciplines across theu800 humanities including philosophy artu800 andu800 literary theory asu800 well asu800 movements such asu800 post-structuralism andu800 postmodernism . seeu800 foru800 example steven best andu800 douglas kellner  postmodern theory  guilford press 1991 which devotes au800 chapter tou800 deleuze andu800 guattari. life life life early life deleuze wasu800 born into au800 middle-class family inu800 paris andu800 lived there foru800 most ofu800 hisu800 life. hisu800 initial schooling wasu800 undertaken during world waru800 iiu800 during which time heu800 attended theu800 lycu8c3a9e carnot . heu800 also spent au800 year inu800 khu8c3a2gne atu800 theu800 lycu8c3a9e henri ivu800 . during theu800 nazi occupation ofu800 france del